pragma solidity ^0.4.22;

/* import './StandAloneT.sol'; */

contract StandAloneT {

    function get() public view returns(uint);

    function set(uint _x) public returns(bool success);

    function getLongWay() public view returns(uint);

}

contract Module {

    /* StandAloneT public s; */
    address public s_addr;

    function setS(address SAAddress) public {
        /* s = StandAloneT(SAAddress); */
        s_addr = SAAddress;
    }

    function get() public view returns(uint) {
        /* return s_addr.call.value(1 ether).gas(10)(abi.encodeWithSignature("get(uint)")); */
        return StandAloneT(s_addr).get();
    }

    function set(uint  _x) public returns(bool success) {
        return StandAloneT(s_addr).set(_x);
    }
}
